import numpy as np

def find_curvature(leftx,rightx,ploty):
    
    #ploty = np.linspace(0, 719, num=720)# to cover same y-range as image
    y_eval = np.max(ploty)
    
    ym_per_pix = 30/720 # meters per pixel in y dimension
    xm_per_pix = 3.7/700 # meters per pixel in x dimension
    
    # Fit new polynomials to x,y in world space
    left_fit_cr = np.polyfit(ploty*ym_per_pix, leftx*xm_per_pix, 2)
    right_fit_cr = np.polyfit(ploty*ym_per_pix, rightx*xm_per_pix, 2)
    # Calculate the new radii of curvature
    left_curverad = ((1 + (2*left_fit_cr[0]*y_eval*ym_per_pix + left_fit_cr[1])**2)**1.5) / np.absolute(2*left_fit_cr[0])
    right_curverad = ((1 + (2*right_fit_cr[0]*y_eval*ym_per_pix + right_fit_cr[1])**2)**1.5) / np.absolute(2*right_fit_cr[0])
    # Now our radius of curvature is in meters
    print("find_curvature :", left_curverad, 'm', right_curverad, 'm')
    return left_curverad, right_curverad
    # Example values: 1926.74 1908.48
#427.408260443 898.015919613 1280
def position_to_center(leftx, rightx, img_width):
    center = img_width*.5
    lane_mid_point = leftx + ((rightx - leftx)*.5)
    result = (center - lane_mid_point)
    #convert to meters
    result = result * (3.7/700)# meters per pixel in x dimension
    print("position_to_center :",result)
    return result

